import { makeStyles } from "@material-ui/core/styles";
import { themes } from '../../themes/index'

export default makeStyles(() => ({
    popup:{
        position: 'fixed',
        width: '100%',
        height: '100%',
        top: 0,
        left: 0,
        right: 0,
        bottom:0,
        margin: 'auto',
        backgroundColor: 'themes',
    },
    }
))
